import React from 'react'
const Hello = (props) => {
    const name = props.name
    const age = props.age
  
    const bornYear = () => new Date().getFullYear() - age
  
    return (
      <div>
        <p>Hello {name}, you are {age} years old</p>
        <p>So you were probably born in {bornYear()}</p>
      </div>
    )
  }

const New = () => {
let persoan = {
    name: 'Arto Hellas',
    age: 35,
  }
 return (
    <div>
        <Hello person={persoan.name} persoan={persoan.age}/>
    </div>
        
        )}


export default New
